import React from "react"

const TodoListItem = props => (
  <li>
    {props.todoItemName}
    <button
      value={props.todoItemId}
      onClick={props.delete.bind(this, props.todoItemId)}
    >
      Delete
    </button>
  </li>
)

export default TodoListItem
